import React from "react";
import { Row, Col } from "react-bootstrap";
import styles from "./style/style.module.css";
import { FaGithub, FaLinkedin } from "react-icons/fa";
import { SiLeetcode } from "react-icons/si";
import { GrEdit } from "react-icons/gr";

const ProfileInfo = (props) => {
  const resume = props.resume;
  const isReferee = props.isReferee;

  return (
    <div>
    <GrEdit />
    <Row className={styles.carddetails}>
      <Col>
        <Row className={styles.name}>{props.name}</Row>

        <Row className={styles.rw}>{props.infotext}</Row>
        {isReferee && (
          <Row className={styles.rw}>
            Graduation year-
            {props.year}
          </Row>
        )}
        <Row>
          <button
            className={styles.button}
            onClick={() => window.open(resume, "_blank")}
          >
            RESUME
          </button>
        </Row>
      </Col>
      <Col className={styles.rightcol}>

        <Row className={styles.link}>
          {isReferee && <Row className={styles.rwc}>{props.college}</Row>}

          <Row className={styles.icons}>
            <Col>

              <a href={props.githublink} target="_blank">
                <FaGithub className="icons" />
              </a>
            </Col>
            <Col className={styles.leet}>
              <a href={props.leetcodelink} target="_blank">
                <SiLeetcode className="icons" />
              </a>
            </Col>
          </Row>

          <Row className={styles.linkicons}>
            <a href={props.linkedinlink} target="_blank">
              <FaLinkedin className="icons" />
            </a>
          </Row>
        </Row>
      </Col>
    </Row>
    </div>
  );
};

export default ProfileInfo;
